function Invoke-Snaffler {
    [CmdletBinding()]
    Param (
        [String]
        $Command = " "
    )

    $base64String = ""

    try {

        $compressedStream = New-Object IO.MemoryStream(,[Convert]::FromBase64String($base64String))
        $decompressed = New-Object IO.Compression.GzipStream($compressedStream, [IO.Compression.CompressionMode]::Decompress)
        $outputStream = New-Object System.IO.MemoryStream
        $decompressed.CopyTo($outputStream)
        [byte[]] $byteOutArray = $outputStream.ToArray()
        $loadedAssembly = [System.Reflection.Assembly]::Load($byteOutArray)

        # 查找包含Main方法的类型，使用正确的BindingFlags
        $mainType = $loadedAssembly.GetTypes() | Where-Object {
            $_.GetMethod("Main", [System.Reflection.BindingFlags]::Static -bor [System.Reflection.BindingFlags]::Public) -ne $null
        } | Select-Object -First 1

        if ($mainType -eq $null) {
            # 如果上面没有找到，尝试直接使用已知的类型名称
            $mainType = $loadedAssembly.GetType("Snaffler.Snaffler")
        }

        if ($mainType -ne $null) {
            Write-Host "使用类型: $($mainType.FullName)" -ForegroundColor Green

            # 获取Main方法
            $mainMethod = $mainType.GetMethod("Main", [System.Reflection.BindingFlags]::Static -bor [System.Reflection.BindingFlags]::Public)

            if ($mainMethod -ne $null) {
                # 重定向输出
                $oldConsoleOut = [Console]::Out
                $stringWriter = New-Object IO.StringWriter
                [Console]::SetOut($stringWriter)

                # 准备参数：Main方法通常接受一个string[]参数
                $parameters = $Command.Split(" ")
                # 调用Main方法，注意：如果Main方法没有参数，那么传递$null
                # 但是，我们从代码中看到Main方法有参数，所以传递参数数组
                $mainMethod.Invoke($null, @(,$parameters))

                [Console]::SetOut($oldConsoleOut)
                $results = $stringWriter.ToString()
                return $results
            } else {
                Write-Error "未找到Main方法"
            }
        } else {
            Write-Error "未找到包含Main方法的类型"
        }
    }
    catch {
        Write-Error "执行Snaffler时出错: $_"
        return $null
    }
}